import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = ({ loggedIn, onLogout, onShowLoginForm, onShowSignupForm }) => {
  return (
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        {!loggedIn && <li><button onClick={onShowLoginForm}>Login</button></li>}
        {!loggedIn && <li><button onClick={onShowSignupForm}>Signup</button></li>}
        {loggedIn && <li><button onClick={onLogout}>Logout</button></li>}
      </ul>
    </nav>
  );
};

export default Navbar;
